import React from "react";
import "./SideBar.css";

function SideBar({ repos, onRepoSelect }) {
    return (
        <div className="sidebar">
            <h3>Repositories</h3>
            <ul>
                {repos.map((repo, index) => (
                    <li key={index} onClick={() => onRepoSelect(repo)}>
                        {repo}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default SideBar;
